        <s.CategoryFilterBodyItem>높은 가격순</s.CategoryFilterBodyItem>
        <s.CategoryFilterBodyItem>평점순</s.CategoryFilterBodyItem>
        <s.CategoryFilterBodyItem>리뷰 많은순</s.CategoryFilterBodyItem>
      </s.CategoryFilterBody>
      <s.CategoryFilterButtonContainer>
        <s.CategoryFilterButton>적용하기</s.CategoryFilterButton>
      </s.CategoryFilterButtonContainer>
    </s.CategoryFilterContainer>
  );
};

export default CategoryFilter;
